INSERT INTO `v1_0bc2befeeb4931c5baf97fb0e307115b7adeb3d326bb4fed634af7dbeabcf1c7` VALUES ("", 1007410, "", "", "", "私の血を吸ってみる？", 103, 1007410053, 0, "", 1007410066);
INSERT INTO `v1_0bc2befeeb4931c5baf97fb0e307115b7adeb3d326bb4fed634af7dbeabcf1c7` VALUES ("", 1007410, "", "", "", "私の目、使っちゃおうかしら？", 103, 1007410054, 0, "", 1007410072);
